import React from 'react';
import { Link } from 'react-router-dom';

const NotFound = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center text-center bg-light px-4">
      <h1 className="text-6xl font-playwrite text-primary mb-4">404</h1>
      <p className="text-xl text-gray-600 font-inter mb-6">
        Oops! The page you're looking for doesn't exist.
      </p>
      <Link
        to="/"
        className="text-white bg-primary px-6 py-2 rounded-md text-lg font-inter hover:bg-accent transition"
      >
        Go Back Home
      </Link>
    </div>
  );
};

export default NotFound;
